import Switch from "react-router-dom";
import Route from "react-router-dom";


export default function TopNavRouter() {
    // Declare a new state variable, which we'll call "count"
    const [count, setCount] = useState(0);

    return (
        <Switch>
            <Route path="/about">
                <Home />
            </Route>
            <Route path="/users">
                <Dashboard />
            </Route>

        </Switch>
    );
}
